function TodoItem({ todoName, todoDate }) {
    return (
        <div className="rows">
        <ul class="list-group list-group-flush">
        <li class="list-group-item">{todoName}</li>
        </ul>
        <ul class="list-group list-group-flush">
        <li class="list-group-item">{todoDate}</li>
        </ul>
        </div>
    );
  }
  
  export default TodoItem;
